import re

def extract_product_attributes(product_title):
    """"""
    attributes = {}
    brand_match = re.match('^([A-Za-z]+)', product_title)
    if brand_match:
        attributes['brand'] = brand_match.group(0)
    item_match = re.search('(Headphones|Laptop|Monitor|Speaker|Camera|TV|Tablet|Phone)', product_title)
    if item_match:
        attributes['item'] = item_match.group(0)
    color_match = re.search('(Black|White|Red|Blue|Green|Yellow|Gray|Silver|Gold|Rose|Pink|Purple)', product_title)
    if color_match:
        attributes['color'] = color_match.group(0)
    model_number_match = re.search('[A-Z]{3}-[A-Z]{2}\\d{3}', product_title)
    if model_number_match:
        attributes['model_number'] = model_number_match.group(0)
    return attributes
